create table if not exists region
(
    id               bigint auto_increment comment 'id'
        primary key,
    name             varchar(50)                        not null comment '区域名称',
    code             varchar(20)                        not null comment '区域编码',
    parent_id        bigint                             null comment '父区域ID',
    level            tinyint                            not null comment '区域级别：1-省, 2-市, 3-区县',
    status           tinyint  default 1                 not null comment '状态：0-禁用, 1-启用',
    create_time      datetime default CURRENT_TIMESTAMP not null comment '创建时间',
    update_time      datetime default CURRENT_TIMESTAMP not null on update CURRENT_TIMESTAMP comment '更新时间',
    is_delete        tinyint  default 0                 not null comment '是否删除',
    center_longitude decimal(10, 6)                     null,
    center_latitude  decimal(10, 6)                     null,
    boundary_points  text                               null comment '边界坐标点GeoJSON格式',
    constraint uk_code
        unique (code)
)
    comment '区域信息表' collate = utf8mb4_unicode_ci;


